export function Render()
{
    sendZone(1);
    sendZone(2);
    Apply(1);
    Apply(2);
}


function sendZone(zone, shutdown = false)
{
    var packet = []
    packet[0x00] = 0x07;
    packet[0x01] = 0xEA;
    packet[0x02] = zone;
    packet[0x03] = 0x02;
    
    for(var iIdx = 0; iIdx < 4; iIdx++)
	{
     var iPxX = vLedPositions[iIdx][0];
     var iPxY = vLedPositions[iIdx][1];
     var color;
     if(shutdown)
		{
         color = hexToRgb(shutdownColor)
        }
	 else if (LightingMode == "Forced") 
		{
         color = hexToRgb(forcedColor)
        }
	 else
		{
         color = device.color(iPxX, iPxY);
        }

     var iLedIdx = 4 + iIdx * 4
     packet[iLedIdx] = 0xff;
     packet[iLedIdx+1] = color[0];
     packet[iLedIdx+2] = color[1];
     packet[iLedIdx+3] = color[2];
    }
    packet[20] = 0x01;
    packet[21] = 0x01;
    packet[22] = 0x01;
    packet[23] = 0x01;
    packet[24] = 0x00;
    packet[25] = 0x00;
    device.send_report(packet, 40);
    device.get_report(packet, 40);
}

function Apply(zone)
{
    var packet = []
    packet[0x00] = 0x07;
    packet[0x01] = 0xEA;
    packet[0x02] = zone;
    packet[0x03] = 0x01;
    packet[0x04] = 0x01;
    packet[0x05] = 0x01;
    packet[0x06] = 0x01;
    packet[0x07] = 0x01;

    device.send_report(packet,40);
}

export function Validate(endpoint)
{
    return endpoint.interface === 1 && endpoint.usage === 0x004b && endpoint.usage_page === 0x0008;
}

function hexToRgb(hex)
{
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
}

